import React , {useEffect,useState } from 'react';

import { getProducts } from './helper/Coreapicalls';
import Base from './Base';

export default function Home() {

  const [products,setProducts]=useState([]);
  const [error,setError]=useState(false);


  const loadallProducts = () => {
    getProducts()
      .then((data) => {
        if (data && data.error) {
          setError(data.error);
          console.log(error);
        } else {
          
          setProducts(data);
        }
      });
  };

  useEffect(() => {
		loadallProducts();
	}, []);

  return (
    <Base>
      <h1>Home component</h1>
      <div>
      <div className="container">
        <div className="row">
          <div className="col-md-3 col-sm-6">
            <div className="product-grid">
              <div className="product-image">
                <a href="#" className="image">
                  <img className="pic-1" src="images/img-1.jpg" />
                  <img className="pic-2" src="images/img-2.jpg" />
                </a>
                <span className="product-sale-label">sale!</span>
                <ul className="social">
                  <li><a href="#" data-tip="Quick View"><i className="fa fa-eye" /></a></li>
                  <li><a href="#" data-tip="Add to wishlist"><i className="fa fa-heart" /></a></li>
                </ul>
                <div className="product-rating">
                  <ul className="rating">
                    <li className="fas fa-star" />
                    <li className="fas fa-star" />
                    <li className="fas fa-star" />
                    <li className="far fa-star" />
                    <li className="far fa-star" />
                  </ul>
                  <a className="add-to-cart" href="#"> ADD TO CART </a>
                </div>
              </div>
              <div className="product-content">
                <h3 className="title"><a href="#">Men's Shirt</a></h3>
                <div className="price"><span>$28.00</span>$20.00</div>
              </div>
            </div>
          </div>
          <div className="col-md-3 col-sm-6">
            <div className="product-grid">
              <div className="product-image">
                <a href="#" className="image">
                  <img className="pic-1" src="images/img-3.jpg" />
                  <img className="pic-2" src="images/img-4.jpg" />
                </a>
                <ul className="social">
                  <li><a href="#" data-tip="Quick View"><i className="fa fa-eye" /></a></li>
                  <li><a href="#" data-tip="Add to wishlist"><i className="fa fa-heart" /></a></li>
                </ul>
                <div className="product-rating">
                  <ul className="rating">
                    <li className="fas fa-star" />
                    <li className="fas fa-star" />
                    <li className="fas fa-star" />
                    <li className="far fa-star" />
                    <li className="far fa-star" />
                  </ul>
                  <a className="add-to-cart" href="#"> ADD TO CART </a>
                </div>
              </div>
              <div className="product-content">
                <h3 className="title"><a href="#">Women's Tshirt</a></h3>
                <div className="price">$19.00</div>
              </div>
            </div>
          </div>
        </div>
      </div>
      </div>
    </Base>
  ); 
}
